const ViewMoreActions = (props) => {

    return  <div style={props.linkStyle} 
                 onMouseEnter={props.viewMoreActions(null)} 
                 onMouseLeave={props.cancelViewMoreActions(null)} >

                    <p> More actions </p>
                    <Button  className='bg-success d-block mx-auto w-75 mt-5 '>Send a message</Button>
                    <Button onClick={props.blockClick} className='bg-danger d-block mx-auto w-75 mt-3'>block</Button>

             </div> 
 }

 export default ViewMoreActions
